import logo from './logo.svg';
import './App.css';
import React from 'react';
import styled from "styled-components";
import Week from './Week';
import Detail from './Detail';


const list = [
  '목', '금', '토','일','월','화', '수'
]

console.log(list)

function App() {
  return (
    <div className="App">
      <Container>
      <Week/>
      </Container>
    </div>
  );
} 

const Container = styled.div`
  max-width: 350px;
  min-height: 80vh;
  background-color: #fff;
  padding: 16px;
  margin: 20px auto;
  border-radius: 5px;
  border: 1px solid #ddd;
`;

export default App;
